import React from 'react';
import classes from './Description.module.css';
import jsImage from '../../assets/javascript_round.png';

const description = () => {
    return (
        <div className={classes.Description}>
            <h1>FRONT END FOCUSED WITH FULL STACK EXPERIENCE</h1>
            <div className={classes.skillsContainer}>
                <p>As a primarily self-taught front-end developer, I have focused my skills on JavaScript and ReactJS. Additional skills include Express JS and Node.js for server development and MongoDB for Database development.</p>
                <div className={classes.imagesContainer}>
                    <img src={jsImage} height={100} width={100}/>
                </div>
            </div>
        </div>
    )
}

export default description;
